import React from "react";
import { Container, Box } from "@chakra-ui/react";
const ChatHome = () => {
  return (
    <Container maxW="xl" centerContent>
      <Box
        d="flex"
        justifyContent="center"
        textAlign="center"
        p={3}
        // bg={"white"}
        w="100%"
        m="40px 0 15px 0"
        borderRadius="lg"
        borderWidth="1px"
      >
        <h3 color="black">Login/Signup</h3>
      </Box>
    </Container>
  );
};

export default ChatHome;
